import { Component, ViewChild } from '@angular/core';
import { IonicPage, NavController, LoadingController, NavParams, ToastController, Platform, Content} from 'ionic-angular';
import { ImagePicker } from '@ionic-native/image-picker';

import { Facebook } from '@ionic-native/facebook';


import { AppDataServiceProvider } from '../../providers/app-data-service/app-data-service';
import { Storage } from '@ionic/storage';
@IonicPage()
@Component({
  selector: 'page-sign-up',
  templateUrl: 'sign-up.html',
})
export class SignUpPage 
{
  @ViewChild('myContent') content: Content;
  public canvasWidth;
  public canvasHight;
  userData;
  
  id;
  profile_picture;
  name;
  email;
  password;
  facebook_auth_id;

  faceBookToken;
  faceBookUserId;
  error;

  spinner;
  options = 
  {
    maximumImagesCount: 1,
    width: 200,
    // height: 300,
    quality: 100,
    outputType: 1
  }
  constructor(
  	public navCtrl: NavController,
  	public navParams: NavParams,
  	private DataService: AppDataServiceProvider,
    private storage: Storage,
    public imagePicker: ImagePicker,
    private Facebook: Facebook,
    private toast: ToastController,
    public platform: Platform,
    public loading: LoadingController,
    ) 
   {
	  	this.userData = this.storage.get('user')
        .then((responeUserData)=>
      {
         if (responeUserData) {
            this.userData = responeUserData;
         }else{
           this.userData.image = 'assets/icon/marker.png';
           this.userData.name = '';
         }
        this.ionViewDidLoad();

      });
   }

  ionViewDidLoad() {
    this.canvasWidth = this.platform.width() /  1.5;
    this.canvasHight = this.platform.width() /  1.5;
  }
  facebookSignUp()
  {
   this.Facebook.login(['public_profile', 'user_friends', 'email'])
     .then(data=>{
       this.faceBookToken=data.authResponse.accessToken;
       this.faceBookUserId=data.authResponse.userID;

       //Call getter function
       this.onGetDetailsClick();
     } )
      .catch(e => {
        this.error = JSON.stringify(e);
        // alert(JSON.stringify(e));
      } );
  }


 onGetDetailsClick()
 {
   this.Facebook.api(this.faceBookUserId+"/?fields=name,id,email,picture,birthday,gender",['public_profile']).then(data=>{

      // picture = JSON.stringify(data.picture.data.url);
      this.id                =   data.id;
      // this.profile_picture   =   "http://graph.facebook.com/" + this.id + "/picture?width=300?";
      // this.profile_picture   =   
     // 'data:image/png;base64,';
      this.name              =   data.name;
      this.email             =   (data.email) ? data.email : null;
      this.facebook_auth_id  =   (data.id) ? data.id : null;
   });
 }
  signUp()
  {
    if (this.name && this.email  && this.password && this.profile_picture)
    {
      this.DataService.FacebookSignUp(this.name, this.email, this.password, this.profile_picture, this.facebook_auth_id)
      .then(response=>{
        if (response == 'error')
        {
          this.password = null;
          this.facebook_auth_id = null;
        }
      });
    }else
    {
     this.toast.create
      ({
            message:  'Enter information' ,
            duration: 5000,
            position: 'top'
      }).present();
    }
  }
  openGallery()
  {
    this.imagePicker.getPictures(this.options).then(file_uris => { if (file_uris != '') {  var  img = new Image; img.src = 'data:image/jpeg;base64,' + file_uris;
        
        // var  img = new Image; img.src =  "data:image/jpeg;base64,";
        

        // this.showLoading();
        var canvas : any = document.getElementById("canvas");
        var ctx = canvas.getContext('2d');
        var  x = 0;
        var  y = 0;
        var  w = ctx.canvas.width;
        var  h = ctx.canvas.height;
        var offsetX = 0.5;
        var offsetY = 0.5;
        var that = this;
        img.crossOrigin = '';
        img.onload = function()
        {
            var iw = img.width,
                ih = img.height,
                r = Math.min(w / iw, h / ih),
                nw = iw * r,   /// new prop. width
                nh = ih * r,   /// new prop. height
                cx, cy, cw, ch, ar = 1;

            /// decide which gap to fill    
            if (nw < w) ar = w / nw;
            if (nh < h) ar = h / nh;
            nw *= ar;
            nh *= ar;

            /// calc source rectangle
            cw = iw / (nw / w);
            ch = ih / (nh / h);

            cx = (iw - cw) * offsetX;
            cy = (ih - ch) * offsetY;

            /// make sure source rectangle is valid
            if (cx < 0) cx = 0;
            if (cy < 0) cy = 0;
            if (cw > iw) cw = iw;
            if (ch > ih) ch = ih;

            /// fill image in dest. rectangle
            ctx.drawImage(img, cx, cy, cw, ch,  x, y, w, h);
            that.profile_picture = canvas.toDataURL();
            // that.hideLoading();
        }

    }},err => alert('uh oh'));
  }

  ConvertImgToBase64URL()
  {
    var canvas : any = document.getElementById("canvas");
    let ctx =  canvas.getContext('2d');
    var img = document.getElementById("profile_picture");
    ctx.drawImage(img, 30, 30);
      return canvas.toDataURL();
  }
  showLoading(){this.spinner =  this.loading.create({content: "Please wait..."});this.spinner.present();}
  hideLoading(){ this.spinner.dismiss(); }

}
